  [],\n\t\"revision_timestamp\": \"2016-07-27T22:40:39.776010\",\n\t\"name\": \"alligator-river-national-wildlife-refuge-pea-island-national-wildlife-refuge-annual-narr-2-58f39\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alligator
  River NWR and Pea Island NWR outlines Refuge accomplishments during the 2008 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, compliance with environmental and cultural resource mandates, and
  research and investigations. Refuge administration is outlined; information about
  personnel, volunteer programs, funding, safety, and technical assistance is given.
  Habitat management is also covered; subjects include wetlands, forests, croplands,
  fire management, and pest control. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, marine mammals, and animal control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  equipment replacement, and computer systems. Cooperative programs are provided at
  the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
